const init = {
    menuSelected: "home"
};

export default (state=init, action) => {
    switch (action.type) {
        case 'ON_MENU_CHANGE':
            return {...state, menuSelected: action.payload};
        case 'ON_HOME_MENU_CHANGE':
            console.log(action.payload);
            return {...state, homeMenuSelected: action.payload};

        default:
            return {...state};
    }
}
